  public static String removeParameterQualification(String _string) {
    final StringBuilder b = new StringBuilder();

    // Get everything between the brackets
    final int i = _string.indexOf("(");
    final int j = _string.lastIndexOf(")");
    if (i == -1 || j == -1)
